graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Priority Edges</b></font></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="logLevel__key" align="left" balign="left">logLevel</td><td port="logLevel__value" align="left" balign="left">debug</td></tr></table></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Data" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Data</b> <i>&lt;context&gt;</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="itemCount__key" align="left" balign="left">itemCount</td><td port="itemCount__value" align="left" balign="left">0</td></tr></table></td></tr></table>>, shape=folder, fillcolor="#E8F5E9", style=filled, color="#388E3C"];
  "CheckData" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>CheckData</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Check data</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "ProcessNormal" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProcessNormal</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Normal processing</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "ProcessUrgent" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProcessUrgent</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Urgent processing</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "ProcessDefault" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProcessDefault</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Default processing</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];

  // Edges
  "CheckData" -> "ProcessUrgent" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">@priority when=Data.itemCount &gt; 100</td></tr></table>>, labelOverlay="75%", labelhref="#srcLineTBD", style=solid, color="#4CAF50", penwidth=2];
  "CheckData" -> "ProcessNormal" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">@priority when=Data.itemCount &gt; 0</td></tr></table>>, labelOverlay="75%", labelhref="#srcLineTBD", style=solid, color="#4CAF50", penwidth=2];
  "CheckData" -> "ProcessDefault" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">@priority 3</td></tr></table>>, labelOverlay="75%", labelhref="#srcLineTBD"];

  // Inferred Dependencies
  "CheckData" -> "Data" [label="condition references Data", style=dashed, color=blue];
  "CheckData" -> "Data" [label="condition references Data", style=dashed, color=blue];
}
